  <td height=20 colspan=15 width=960 style='height:15.0pt;mso-ignore:colspan;
  width:720pt'>Figure 3. Time to first exacerbation in high-dose ICS (&#3;1600
  mg/day), medium-dose ICS (401 -1599 mg/day) and low-dose ICS (400 mg/day)
  patients.</td>
 </tr>
 <tr height=20 style='height:15.0pt'>
  <td height=20 colspan=15 style='height:15.0pt;mso-ignore:colspan'>In this
  subgroup analysis, the shortest time to the first exacerbation was observed
  in the HD stratum, followed by the MD and LD strata (Figure 3).<span
  style='mso-spacerun:yes'> </span></td>
